import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const ProductSearch = () => {
  const [query, setQuery] = useState('');
  const navigate = useNavigate();

  const searchProduct = () => {
    // API orqali mahsulotni qidirish
    fetch(`https://66d6dd72006bfbe2e64ee358.mockapi.io/user/Products?search=${query}`)
      .then(response => response.json())
      .then(data => {
        if (data.length > 0) {
          // Mahsulot topildi, shop sahifasiga yo'naltirish
          navigate('/Shop');
        } else {
          // Mahsulot topilmadi, 404 sahifasiga yo'naltirish
          navigate('/Contact');
        }
      })
      .catch(error => {
        console.error('API bilan bog‘lanishda xato:', error);
        // Xato bo'lsa ham 404 sahifasiga yo'naltirish
        navigate('/About');
      });
  };

  return (
    <div class="input-container">
    <input type="text" placeholder="Search" class="text-input"   value={query}
       onChange={e => setQuery(e.target.value)}/>
    <button class="input-button" onClick={searchProduct} >Send</button>
  </div>

  );
};

export default ProductSearch;
